INSERT INTO `object_type` VALUES (1,'501DE199-18B8-4093-BED4-996119ED1910','Котельная','Основным элементом газовой системы отопления любого производителя, является теплообменный аппарат, который позволяет преобразовывать в котельной один вид энергии в другой. В нашем случае с газовой котельной, химическая энергия газа преобразуется в тепловую энергию воды, которая и является непосредственным рабочим телом в отоплении помещения.','501DE199-18B8-4093-BED4-996119ED1910.jpg','2017-04-05 05:56:13','2017-04-05 05:56:13'),(2,'E6814CC6-8759-4EB0-A345-7D35B5E87BD9','Завод','Завод','E6814CC6-8759-4EB0-A345-7D35B5E87BD9.jpg','2017-04-05 06:39:51','2017-04-05 06:39:51'),(3,'31A4C793-E2FC-4BF4-8B7F-3B05D53D05EF','ГРП','Газорегуляторный пункт - комплекс технологического оборудования и устройств, предназначенный для понижения входного давления газа до заданного уровня и поддержания его на выходе постоянным независимо от расхода газа. ','31A4C793-E2FC-4BF4-8B7F-3B05D53D05EF.jpg','2017-06-13 06:12:42','2017-06-13 06:12:42'),
